            edges[edge_count].u = parent;
            edges[edge_count].v = i;
            degree[parent]++;
            degree[i]++;
            edge_count++;
        }
    }

    int current = 1;
    for (int i = 1; i <= edge_count; ++i) {
        while(degree[current] > 1) {
            current++;
        }
        if (edges[i - 1].u == current || edges[i - 1].v == current) {
            continue;
        }

        if (edges[i - 1].u > 1) {
            edges[i - 1].u = current;
        } else {
            edges[i - 1].v = current;
        }

        degree[current]++;
        current++;
    }

    free(degree);
    free(components);

    return n - 1;
